window.bookSummaryJSON = "<p><b>I have a secret and I'm going to tell you.</b></p> <p>I'm the last Full-blood Witch. I'm the last Savill Royal. I'm the heir to a throne four King's rule the world from.</p> <p>I told my secret twice now, to you and my best friend. Now it is time to keep that secret again. Because if they knew I was still alive, it would mean losing my freedom. Maybe even my life.</p> <p>Only for me to end up in the wrong place. Their place.</p> <p>Contains mature themes.</p>"; 
